For countless years we’ve been coming to Miami for a quick getaway (sans kids). I’m no expert, but after numerous DMs asking about my fave spots, I figured I’d put together a little post. Let me know any must haves for next time! 🌴

@miamibeachedition - We love the boutique-iness feeling of this hotel. It’s right on the beach and has the most divine scent (did you know many hotels have a “scent program”?!). 

@marketatedition - The most delish breakfast and a great spot if you want to leave the pool/beach. It’s a @chefjgv restaurant so it has to be 🤌🏼. 

@matadorroom - Another @chefjgv restaurant with a gorgeous bar. We’ve eaten dinner here a bunch because it’s convenient but also beautiful outside with yummy food. 

@contessaristorante - We ate here the first night and it’s probably my favorite looking restaurant I’ve been to in a long time. It’s sexy, so well designed and the food did not disappoint. The lobster pasta, whipped ricotta toast and the octopus appetizer were my favorites. OH, and the lemon roasted meringue dessert is to die for. @majorfoodgroup nailed this one. 

@milagroup_miami - Love this spot for Asian-inspired bites and the cocktails. The outside is equally beautiful, and every 30 mins there seems to be a fire show. This was our second time in a row coming back here. The mushroom hot pot with truffles is a decadent must order dish. 

@mandolinrestaurants - This is always a home run meal. You feel like you’re transported out of the US eating in the beautiful garden. It has my fave Greek salad, pita and every other bit of authentic Greek food. And if it happens to be chilly, which it def wasn’t this trip, they give you blankets to cozy up with. 

@faenabazaarcurio - This is our fave spot to shop down here. It’s the most gorgeous curated boutique for both men and women. Every piece feels special and @danie05 does the best job selecting every designer and piece she carries. My fave @carolinakuniverse sells her entire collection here (peep the jumpsuit and silk pants I bought). 

#cocoincashmere #miami #fashionstylist #miamibeach

