We’ve been coming to Windham to ski for almost 8 years now and love so many things about it. While I’m no expert, here are the highlights in my opinion! 

@wylderhotelwind - Cannot recommend this hotel (complex!) enough. After being so disappointed w the place we used to stay at, this is a MAJOR upgrade. It’s also dog friendly and there’s a closed off dog run which Lou Dog loved (and ran around endlessly in the snow!). There are fire pits lit at night and during the summer there looks to be a huge and brand new outdoor pool. There’s also the coolest forest green Defender parked outside (and shown here) to shuttle you to and from the mountain. 

@babblersny — This is the restaurant/bar in the hotel. Breakfast is located in the bakery area of it and lunch and dinner is in the main dining room. The bar also has this delish cocktail called the UVA (pictured here, @casamigos blanco, muddled grapes, fresh lime juice, agave and habanero bitters 🤌🏼). 

@briarsandbramblesbooks — Such an adorable book store that’s well stocked with books as well as leather bound notebooks and pens (which we got for the kids). 

@chickenrunwindham — Hands down the best place in Windham. It’s a super kid-friendly spot (there are claw machines up front for them!) and has an extensive menu. They also sell everything for s’mores so you can make them outside. 

@highergroundswindhamny — We always make a stop here for breakfast. Everything is homemade and the staff couldn’t be sweeter. 

@hickoryhillmarket — I love the is market so much. It’s so well curated, from healthy snacks to make-your-own candy bags, and they have such a great iced coffee setup (with every kind of milk and flavored creamer!). 

#cocoincashmere #windham #windhamny #travel

