Every time I come down here I feel reenergized, recharged, grounded (literally waking barefoot on the beach) and crazy active. While not every place was open (more open after Easter), here are some of the hits we visited!

@black_whale_lbi - Our fave for seafood and they have a great kids menu. It’s way easier to get in here off season. 

@buckalewslbi - The kids love the mac n cheese (I swear it’s Kraft)and grilled cheese, and the sushi satisfied my craving. My all time fave sushi is from @englesideinnlbi but they were closed the days we were down. 

@fantasyislandlbi - The inside arcade was open and this definitely took up a chunk of time. The kids racked up points towards prizes and I won two stuffed animals from the claw machines (my not-so-secret talent 😉). 

@out_of_sight_alpacas - My mom has been talking about taking us here for a couple of years so we finally all went. It’s about ten minutes off the island. The tour guide was knowledgeable and we ALL loved interacting and feeding the alpacas. The gift shop is also super cute. 

@localmarket_lbi - Whenever I’m at the other end of the island I always make a pit stop for their iced coffee, pastries and sandwiches. It’s a really great little gourmet market. 

@tuckerslbi - This place is always good. There’s usually some sort of live entertainment in the background and the menu is solid. 

These past few days got me super jazzed for the summer! 🏖️ 

