As promised, here’s my Montreal little roundup of what we ate and did. This was a quick trip! I also included some places a bunch of you recommended but we didn’t get to go to… 

@seasaltmtl - we had cocktails outside and very much felt like Paris. Great vibe (it also poured as we were sitting and they have massive umbrellas).

 @jatobamontreal - obsessed with this meal. All of the sushi was insane. We ordered a bunch of things and all shared. The waiter forgot to bring the eggplant dish, which I’m told is an absolute must. 

We all ran in the morning along the water which felt like a treat. I’m used to hills and happily will take flat any time I can get it!

@arthursmtl - this one came highly recommended and was worth every minute of the wait. We sat inside (took what we could get!) and it was chilly so I now have an Arthurs’s sweatshirt in my wardrobe. 😊 The Caesar (Canadian take on a Bloody Mary) is a must, along with the French toast, strawberry pancakes and the best avocado toast with fried egg I’ve ever had before. You can’t go wrong earring anything on this menu!

@cordova.st.henri - we got delish iced coffees here while we waited to sit at Arthur’s. It’s right across the street. You can also get a morning cocktail!

@damasrestaurant - possibly the best Syrian food I’ve ever had. The mezzes were all delish (def get the hummus and the eggplant mutabbal), the grilled shrimp and everybody was dying over the lamb (I don’t eat lamb). 

Recs from you guys: @joebeef, La vin Papillon, Kyo, Au Pied de Cochon, L’express, Beauty’s

