As promised, our London roundup. This was mine and the kids first time ever there and we LOVED it! 🇬🇧 

London panoramic tour in a black cab- we saw lots of classic sites including changing of the guard 💂‍♀️at Buckingham Palace. This private tour (was about 4 hours) was definitely worth the money. 

@boroughmarket - our guide brought us here and it’s definitely a highlight. One of the most well known things are the strawberries with drizzled chocolate (how are their berries THAT good?!) 

London Eye- such a cool thing to see a 360 deg bird’s eye view of the city. 

Thames rib ride- unanimously our favorite thing. This super-fast speed boat was a ride of sightseeing (when it went slower) and feeling like you’re on a roller coaster (when we went 35 mph). It was an intimate and crazy fun ride, and a perfect way to see the city from a different perspective. 

Notting Hill- we explored the boutiques + bought some awesome art from @selectgallery.art which should be arriving today! 🤞🏻

@graffikgallery where @mauricioglor_ taught us how to be graffiti artists! I might quit my day job. 

Tower of London- we explored on our own (and with headsets) which took a couple of hours. 

East End food tour- we were able to advance in all the food lines with our tour guide and try bites from the most well known bagel with brisket, to fish and chips and handmade chocolates. 

High tea @theconnaught - this place is such a gem and we had the most decadent high tea but it was such an experience. 🫖 🥂 

@harrods- of course we had to go and explore. I love the fact that there’s a gorg book shop on the lower level. 

Restaurants:
@therivercafelondon- right on the water and a gorg spot. 
@chilternfirehouse for cocktails pre-din (one night we didn’t have the kids w us)
@trishnalondon- sister restaurant to @gymkhanalondon and unbelievable Indian food.
@scottsmayfair- delish seafood and special ambiance. 
@theconnaught @chefjgv- high tea 
Cicchetti’s- an Italian spot in Knightsbridge we ate at for lunch after Harrod’s (it’s right behind it). We sat outside and great pizza for the kids. 

Shoutout to @travelwithcaline for planning this incredible family vacay!🫶🏻

#cocoincashmere #london

